import"./theme-CJz9fNVZ.js";/* empty css               *//* empty css             */import"./main-BSfib3uD.js";async function a(){try{const s=await(await fetch("/data/teams.json")).json(),n=document.getElementById("teams-grid");if(!n)return;n.innerHTML="",s.forEach(e=>{const r=document.createElement("a");r.href=e.href;const t=document.createElement("team-card");t.setAttribute("name",e.name),t.setAttribute("conference",e.conference),t.setAttribute("wins",e.wins),t.setAttribute("losses",e.losses),r.appendChild(t),n.appendChild(r)})}catch(o){console.error("Failed to load teams:",o),document.getElementById("teams-grid").innerHTML='<p style="color: var(--muted-foreground);">Failed to load teams. Please try again.</p>'}}document.readyState==="loading"?document.addEventListener("DOMContentLoaded",a):a();
